import React from 'react';
import './Quote.css';
import { TweenMax, Expo } from 'gsap';
import Media from 'react-media';

// REturn Quote 
export default function REturnQuOte() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};


export const ScreenLarge = () => {
 React.useEffect(() => {
  TweenMax.from('.wrp-quote-sign p', 1.3, { delay: 1.5, opacity: 0, y: 0, ease: Expo.easeInOut });
 }, []);

 return (
  <div className='wrp-quote-sign'>
   <ViewText />
  </div>
 )
};
export const ScreenSmall = () => {

 React.useEffect(() => {
  TweenMax.from('.wrp-quote-sign-sm p', 1.3, { delay: 1.5, opacity: 0, y: 0, ease: Expo.easeInOut });
 }, []);

 return (
  <div className='wrp-quote-sign-sm'>
   <ViewText />
  </div>
 )
};
